script: |
  super -f text -I q5289.spq | sort > q5289.out

inputs:
  - name: q5289.spq
    data: |
      SELECT col2 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT - - col2 NOT BETWEEN + col1 + col2 + + CAST ( NULL AS REAL ) * + + col2 AND NULL;
  - name: tab1

outputs:
  - name: q5289.out
    data: |
